data.text:
"... y no puedo resistir el amor: es algo mucho más fuerte que todas mis fuerzas, y me las ha desbaratado."

Mi clarisolcito, el suicida al que algunos llaman adolescente, me reconozco en él, sobretodo por sus detractores; 

¡Ya cumplir 24 años es un anacronismo! https://t.co/dfF9V4YtxF

